import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  color: black;
  background-color: #fdfdfd;
  text-align: center;
  padding-top: 70px;
  padding-bottom: 70px;
`;

const CourserBlock = () => {
  <Container></Container>;
};

export default CourserBlock;
